import React from "react";
import "../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../assets/image_eu/berlin_germany.jpg";
import data from "./modal_data";
import Img1 from "../assets/image_eu/berlin_germany.jpg";
const Modal = () => {
  return (
    <>
      <section className="py-4">
        <div className="row">
          {data.cardData.map((e, index) => {
            return (
              <div className="col-11" key={index}>
                <div className="card">
                  <img src={e.imgSrc} className="card-img-top" />
                  <div className="card-body">
                    <h5 className="card-title">{e.title}</h5>
                    <p className="card-text">{e.desc}</p>
                    <button className="btn btn-primary">Go somewhere</button>
                  </div>
                </div>
              </div>
            );
          })}
        </div>
      </section>
    </>
  );
};

export default Modal;
